import sys
import numpy as np

train_data = np.array(eval(sys.stdin.readline().strip()))
train_label = np.array(eval(sys.stdin.readline().strip()))
test_data = np.array(eval(sys.stdin.readline().strip()))

e_d = np.linalg.norm(train_data - test_data, axis=1)
# print(e_d)

indexs = np.argpartition(e_d, 3)
# print(indexs)

label_dict = {}

nowcount = 0
for i in indexs:
    if nowcount == 3:
        break
    if train_label[i] in label_dict:
        label_dict[train_label[i]] += 1
    else:
        label_dict[train_label[i]] = 1
    nowcount += 1

m = max(label_dict.values())
final_list = sorted(label_dict.items())
for i in final_list:
    if i[1] == m:
        print(i[0])
        break

